package com.fahad.entityclasses;import java.util.ArrayList;import java.util.List;public class FullUserBean {    private String name;    private String userPassword;    private List<Contact> contactsList = new ArrayList<>();    private String contactName;    private String contactPhoneNumber;    public FullUserBean() {    }    public FullUserBean(String name, String userPassword, List<Contact> contactsList, String contactName, String contactPhoneNumber) {        this.name = name;        this.userPassword = userPassword;        this.contactsList = contactsList;        this.contactName = contactName;        this.contactPhoneNumber = contactPhoneNumber;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getUserPassword() {        return userPassword;    }    public void setUserPassword(String userPassword) {        this.userPassword = userPassword;    }    public List<Contact> getContactsList() {        return contactsList;    }    public void setContactsList(List<Contact> contactsList) {        this.contactsList = contactsList;    }    public String getContactName() {        return contactName;    }    public void setContactName(String contactName) {        this.contactName = contactName;    }    public String getContactPhoneNumber() {        return contactPhoneNumber;    }    public void setContactPhoneNumber(String contactPhoneNumber) {        this.contactPhoneNumber = contactPhoneNumber;    }}